const myImage = new Image();
myImage.src = 'data:image/jpeg;base64,';

myImage.addEventListener('load', function () {
    const canvas = document.getElementById('canvas1');
    const ctx = canvas.getContext('2d'); // gives access to all 2d operations
    canvas.width = 980;
    canvas.height = 520;

    ctx.drawImage(myImage, 0, 0, canvas.width, canvas.height);
    const pixels = ctx.getImageData(0, 0, canvas.width, canvas.height);
    ctx.clearRect(0, 0, canvas.width, canvas.height)
    //Particles system ->
    let particlesArray = []; // stores each particle
    const numberOfParticles = 7000;

    let mappedImage = []; // holds pixel data
    // cycling every pixel 
    for (let y = 0; y < canvas.height; y++) {
        let row = [];
        for (let x = 0; x < canvas.width; x++) {
            const red = pixels.data[(y * 4 * pixels.width) + (x * 4)]; // first part has row number and other has column
            const green = pixels.data[(y * 4 * pixels.width) + (x * 4 + 1)];
            const blue = pixels.data[(y * 4 * pixels.width) + x * 4 + 2];
            const brightness = calculateRelativeBrightness(red, green, blue);
            const cell = [
                cellBrightness = brightness,
            ];
            row.push(cell);
        }
        mappedImage.push(row);
    }

    console.log(mappedImage);

    // optimising for rgb color brightness as human eye doesn't perceive each color's brightness equally
    function calculateRelativeBrightness(red, green, blue) {
        return Math.sqrt(
            (red * red) * 0.299 + (green * green) * 0.587 + (blue * blue) * 0.114
        ) / 100;
    }

    class Particle {
        // constructor is mandatory to create each particle a default value
        constructor() {
            this.x = Math.random() * canvas.width;
            this.y = 0;
            this.speed = 0;
            this.velocity = Math.random() * 5.5;
            this.size = Math.random() * 1.5 + 1;
            this.position1 = Math.floor(this.y);
            this.position2 = Math.floor(this.x);
        }
        // update the particle before redrawing it
        update() {
            this.position1 = Math.floor(this.y);
            this.position2 = Math.floor(this.x);
            this.speed = mappedImage[this.position1][this.position2][0];
            let movement = (2.5 - this.speed) + this.velocity;

            this.y += movement;
            if (this.y >= canvas.height) {
                this.y = 0;
                this.x = Math.random() * canvas.width;
            }
        }
        // draws a circle around particle to represent it
        draw() {
            ctx.beginPath();
            ctx.fillStyle = 'white'; // sets the particle color to shades of white(this can be altered into any color)
            ctx.arc(this.x, this.y, this.size, 0, Math.PI * 2); //particle drawn
            ctx.fill();
        }
    }
    // pushes each particle created into an array 
    function init() {
        for (let i = 0; i < numberOfParticles; i++) {
            particlesArray.push(new Particle);
        }
    }
    init();
    // main animation function for each frame
    function animate() {
        // ctx.drawImage(myImage, 0, 0, canvas.width, canvas.height);
        ctx.globalAlpha = 0.05;
        ctx.fillStyle = 'rgb(0,0,0)';
        ctx.fillRect(0, 0, canvas.width, canvas.height);
        ctx.globalAlpha = 0.2;
        for (let i = 0; i < particlesArray.length; i++) {
            particlesArray[i].update();
            ctx.globalAlpha = particlesArray[i].speed * 0.5;
            particlesArray[i].draw();
        }
        requestAnimationFrame(animate);
    }
    animate();
});